about the members of a cooking course (who mostly talk about their
sorry lives) and fourthly about the funeral for a womanizing trotter
jockey, who tries to continue orchestrating the family from beyond the
grave, by singing and appearing in 3D during the funeral, thanks to
high tech equipment that has cost his entire fortune (the family gets
nil, not even the famous horse is given to the family)!

